org\/wiki\/%D0%92%D0%B0%D0%BB%D1%8C%D0%B4%D0%B8%D0%B2%D0%B8%D1%8F\" title=\"\u0412\u0430\u043b\u044c\u0434\u0438\u0432\u0438\u044f\">\u0421\u0430\u043d\u0442\u0430-\u041c\u0430\u0440\u0438\u0430-\u043b\u044f-\u0411\u043b\u0430\u043a\u0430-\u0434\u0435-\u0412\u0430\u043b\u044c\u0434\u0438\u0432\u0438\u044f<\/a>, \u0441\u0442\u0430\u0432\u0448\u0438\u0439 \u043e\u0434\u043d\u0438\u043c \u0438\u0437 \u0444\u043e\u0440\u043f\u043e\u0441\u0442\u043e\u0432 \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0445 \u043a\u043e\u043b\u043e\u043d\u0438\u0437\u0430\u0442\u043e\u0440\u043e\u0432, \u0432\u043f\u043b\u043e\u0442\u044c \u0434\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1810\" class=\"mw-redirect\" title=\"1810\">1810<\/a>\u2014<a href=\"https:\/\/ru.wikipedia.org\/wiki\/1811_%D0%B3%D0%BE%D0%B4\" title=\"1811 \u0433\u043e\u0434\">1811&#160;\u0433\u043e\u0434\u043e\u0432<\/a>, \u043a\u043e\u0433\u0434\u0430 \u0427\u0438\u043b\u0438 \u0441\u0442\u0430\u043b\u043e \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u044b\u043c \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1601\" class=\"mw-redirect\" title=\"1601\">1601<\/a>&#160;\u2014 \u0421\u0442\u043e\u043b\u0438\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a> \u0432\u043e\u0437\u0432\u0440\u0430\u0449\u0430\u0435\u0442\u0441\u044f \u0432 \u043f\u0435\u0440\u0432\u0443\u044e \u0441\u0442\u043e\u043b\u0438\u0446\u0443 \u0418\u0441\u043f\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BB%D1%8C%D1%8F%D0%B4%D0%BE%D0%BB%D0%B8%D0%B4\" title=\"\u0412\u0430\u043b\u044c\u044f\u0434\u043e\u043b\u0438\u0434\">\u0412\u0430\u043b\u044c\u044f\u0434\u043e\u043b\u0438\u0434<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1621\" class=\"mw-redirect\" title=\"1621\">1621<\/a>&#160;\u2014 234-\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9\" class=\"mw-redirect\" title=\"\u041f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439\">\u043f\u0430\u043f\u043e\u0439 \u0440\u0438\u043c\u0441\u043a\u0438\u043c<\/a> \u0438\u0437\u0431\u0440\u0430\u043d \u0410\u043b\u0435\u0441\u0441\u0430\u043d\u0434\u0440\u043e \u041b\u044e\u0434\u043e\u0432\u0438\u0437\u0438, \u043f\u0440\u0438\u043d\u044f\u0432\u0448\u0438\u0439 \u0438\u043c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D0%B9_XV\" title=\"\u0413\u0440\u0438\u0433\u043e\u0440\u0438\u0439 XV\">\u0413\u0440\u0438\u0433\u043e\u0440\u0438\u0439 XV<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1695\" class=\"mw-redirect\" title=\"1695\">1695<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D0%B5%D1%86%D0%BA%D0%BE-%D0%B2%D0%B5%D0%BD%D0%B5%D1%86%D0%B8%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1684%E2%80%941699)\" title=\"\u0422\u0443\u0440\u0435\u0446\u043a\u043e-\u0432\u0435\u043d\u0435\u0446\u0438\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1684\u20141699)\">\u041c\u043e\u0440\u0435\u0439\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: \u0443 \u043e\u0441\u0442\u0440\u043e\u0432\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D1%83%D1%81%D1%81%D0%B5%D1%81\" title=\"\u0418\u043d\u0443\u0441\u0441\u0435\u0441\">\u0418\u043d\u0443\u0441\u0441\u0435\u0441<\/a> \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u043e\u0441\u044c <a href=\"https:\/\/en.wikipedia.org\/wiki\/Battle_of_the_Oinousses_Islands\" class=\"extiw\" title=\"en:Battle of the Oinousses Islands\">\u043c\u043e\u0440\u0441\u043a\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435<\/a>, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u043e\u043a\u043e\u043d\u0447