044c\u043d\u044f \u0438\u043c. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D0%B3%D0%B5%D0%BD%D0%B5%D0%B2,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0422\u0443\u0440\u0433\u0435\u043d\u0435\u0432, \u0418\u0432\u0430\u043d \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u0418\u0432\u0430\u043d\u0430 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\u0430 \u0422\u0443\u0440\u0433\u0435\u043d\u0435\u0432\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1886_%D0%B3%D0%BE%D0%B4\" title=\"1886 \u0433\u043e\u0434\">1886<\/a>&#160;\u2014 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%BC%D1%8C%D0%B5%D1%80%D0%B0\" title=\"\u041f\u0440\u0435\u043c\u044c\u0435\u0440\u0430\">\u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430<\/a> \u043e\u043f\u0435\u0440\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D1%81%D0%BE%D1%80%D0%B3%D1%81%D0%BA%D0%B8%D0%B9,_%D0%9C%D0%BE%D0%B4%D0%B5%D1%81%D1%82_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0443\u0441\u043e\u0440\u0433\u0441\u043a\u0438\u0439, \u041c\u043e\u0434\u0435\u0441\u0442 \u041f\u0435\u0442\u0440\u043e\u0432\u0438\u0447\">\u041c.&#160;\u041f.&#160;\u041c\u0443\u0441\u043e\u0440\u0433\u0441\u043a\u043e\u0433\u043e<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D0%B2%D0%B0%D0%BD%D1%89%D0%B8%D0%BD%D0%B0_(%D0%BE%D0%BF%D0%B5%D1%80%D0%B0)\" title=\"\u0425\u043e\u0432\u0430\u043d\u0449\u0438\u043d\u0430 (\u043e\u043f\u0435\u0440\u0430)\">\u00ab\u0425\u043e\u0432\u0430\u043d\u0449\u0438\u043d\u0430\u00bb<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1893\" class=\"mw-redirect\" title=\"1893\">1893<\/a>&#160;\u2014 \u043f\u0435