u0440\u0435\u043f\u0438\u0441\u044c \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u044f \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1900_%D0%B3%D0%BE%D0%B4\" title=\"1900 \u0433\u043e\u0434\">1900<\/a>&#160;\u2014 20-\u043b\u0435\u0442\u043d\u0438\u0439 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0442\u0435\u043d\u043d\u0438\u0441\u0438\u0441\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%8D%D0%B2%D0%B8%D1%81,_%D0%94%D1%83%D0%B0%D0%B9%D1%82_%D0%A4%D0%B8%D0%BB%D0%BB%D0%B8\" title=\"\u0414\u044d\u0432\u0438\u0441, \u0414\u0443\u0430\u0439\u0442 \u0424\u0438\u043b\u043b\u0438\">\u0414\u0432\u0430\u0439\u0442 \u0424. \u0414\u044d\u0432\u0438\u0441<\/a> \u043e\u0441\u043d\u043e\u0432\u044b\u0432\u0430\u0435\u0442 \u043d\u0430\u0437\u0432\u0430\u043d\u043d\u044b\u0439 \u0432 \u0447\u0435\u0441\u0442\u044c \u043d\u0435\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%B1%D0%BE%D0%BA_%D0%94%D1%8D%D0%B2%D0%B8%D1%81%D0%B0\" title=\"\u041a\u0443\u0431\u043e\u043a \u0414\u044d\u0432\u0438\u0441\u0430\">\u041a\u0443\u0431\u043e\u043a \u0414\u044d\u0432\u0438\u0441\u0430<\/a>. \u041f\u0435\u0440\u0432\u044b\u043c \u043e\u0431\u043b\u0430\u0434\u0430\u0442\u0435\u043b\u0435\u043c \u043a\u0443\u0431\u043a\u0430 \u0414\u044d\u0432\u0438\u0441\u0430 \u0431\u044b\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a>, \u0441\u043e \u0441\u0447\u0451\u0442\u043e\u043c 3:0 \u043f\u043e\u0431\u0435\u0434\u0438\u0432\u0448\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044e<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1904_%D0%B3%D0%BE%D0%B4\" title=\"1904 \u0433\u043e\u0434\">1904<\/a>&#160;\u2014 8 \u044f\u043f\u043e\u043d\u0441\u043a\u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BD%D0%BE%D0%BD%D0%BE%D1%81%D0%B5%D1%86\" title=\"\u041c\u0438\u043d\u043e\u043d\u043e\u0441\u0435\u0446\">\u043c\u0438\u043d\u043e\u043d\u043e\u0441\u0446\u0435\u0432<\/a> \u0442\u043e\u0440\u043f\u0435\u0434\u0438\u0440\u043e\u0432\u0430\u043b\u0438 \u0441\u0442\u043e\u044f\u0432\u0448\u0438\u0435 \u043d\u0430 \u0432\u043d\u0435\u0448\u043d\u0435\u043c \u0440\u0435\u0439\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82-%D0%90%D1%80%D1%82%D1%83%D1%80\" title=\"\u041f\u043e\u0440\u0442-\u0410\u0440\u0442\u0443\u0440\">\u041f\u043e\u0440\u0442-\u0410\u0440\u0442\u0443\u0440\u0430<\/a> \u043a\u043e\u0440\u0430\u0431\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D0%BB%D0%BE%D1%82\" class=\"mw-redirect\" title=\"\u0420\u0443\u0441\u0441\u043a\u0438\u0439 \u0444\u043b\u043e\u0442\">\u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430<\/a>. \u042d\u0442\u043e \u043d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u0435 \u043f\u043e\u043b\u043e\u0436\u0438\u043b\u043e \u043d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE-%D1%8F%D0%BF%D0%BE%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0420\u0443\u0441\u0441\u043a\u043e-\u044f\u043f\u043e\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0420\u0443\u0441\u0441\u043a\u043e-\u044f\u043f\u043e\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u0435<\/a>. \u041b\u0435\u0433\u0435\u043d\u0434\u0430\u0440\u043d\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B9_%D1%83_%D0%A7%D0%B5%D0%BC%D1%83%D0%BB%D1%8C%D0%BF%D0%BE\" title=\"\u0411\u043e\u0439 \u0443 \u0427\u0435\u043c\u0443\u043b\u044c\u043f\u043e\">\u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B5%D0%B9%D1%81%D0%B5%D1%80\" title=\"\u041a\u0440\u0435\u0439\u0441\u0435\u0440\">\u043a\u0440\u0435\u0439\u0441\u0435\u0440\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%80%D1%8F%D0%B3_(%D0%BA%D1%80%D0%B5%D0%B9%D1%81%D0%B5%D1%80)\" class=\"mw-redirect\" title=\"\u0412\u0430\u0440\u044f\u0433 (\u043a\u0440\u0435\u0439\u0441\u0435\u0440)\">\u00ab\u0412\u0430\u0440\u044f\u0433\u00bb<\/a> \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u044f\u043f\u043e\u043d\u0441\u043a\u043e\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%81%D0%BA%D0%B0%D0%B4%D1%80%D0%B0\" title=\"\u042d\u0441\u043a\u0430\u0434\u0440\u0430\">\u044d\u0441\u043a\u0430\u0434\u0440\u043e\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B5%D1%81%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80_(%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B0_%E2%80%94_%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B5_%D0%B4%D0%B5%D1%80%D0%B6%D0%B0%D0%B2%D1%8B)\" title=\"\u0411\u0440\u0435\u0441\u0442\u0441\u043a\u0438\u0439 \u043c\u0438\u0440 (\u0423\u043a\u0440\u0430\u0438\u043d\u0430 \u2014 \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0435 \u0434\u0435\u0440\u0436\u0430\u0432\u044b)\">\u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%9D%D0%A0\" class=\"mw-redirect\" title=\"\u0423\u041d\u0420\">\u0423\u041d\u0420<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B5_%D0%B4%D0%B5%D1%80%D0%B6%D0%B0%D0%B2%D1%8B\" title=\"\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0435 \u0434\u0435\u0440\u0436\u0430\u0432\u044b\">\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u043c\u0438 \u0434\u0435\u0440\u0436\u0430\u0432\u0430\u043c\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 \u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0435 \u043a\u043e\u043b\u043e\u043d\u0438\u0430\u043b\u044c\u043d\u044b\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0432\u0441\u0442\u0443\u043f\u0438\u043b\u0438 \u0432 \u0441\u0442\u043e\u043b\u0438\u0446\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%BE_%D0%B4%D0%B5%D1%80%D0%B2%D0%B8%D1%88%D0%B5%D0%B9\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e \u0434\u0435\u0440\u0432\u0438\u0448\u0435\u0439\">\u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430 \u0434\u0435\u0440\u0432\u0438\u0448\u0435\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%BB%D0%B5%D1%85\" title=\"\u0422\u0430\u043b\u0435\u0445\">\u0422\u0430\u043b\u0435\u0445<\/a>. \u0412\u043f\u0435\u0440\u0432\u044b\u0435 \u0441\u0442\u043e\u043b\u043a\u043d\u0443\u0432\u0448\u0438\u0435\u0441\u044f \u0441 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430 \u0434\u0435\u0440\u0432\u0438\u0448\u0435\u0439 \u0440\u0430\u0437\u0431\u0435\u0436\u0430\u043b\u0438\u0441\u044c.&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BF%D0%B8%D1%86%D0%B1%D0%B5%D1%80%D0%B3%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D1%80%D0%B0%D0%BA%D1%82%D0%B0%D1%82\" title=\"\u0428\u043f\u0438\u0446\u0431\u0435\u0440\u0433\u0435\u043d\u0441\u043a\u0438\u0439 \u0442\u0440\u0430\u043a\u0442\u0430\u0442\">\u0428\u043f\u0438\u0446\u0431\u0435\u0440\u0433\u0435\u043d\u0441\u043a\u0438\u0439 \u0442\u0440\u0430\u043a\u0442\u0430\u0442<\/a> \u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BF%D0%B8%D1%86%D0%B1%D0%B5%D1%80%D0%B3%D0%B5%D0%BD\" title=\"\u0428\u043f\u0438\u0446\u0431\u0435\u0440\u0433\u0435\u043d\">\u0428\u043f\u0438\u0446\u0431\u0435\u0440\u0433\u0435\u043d\u0435<\/a>, \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0438\u0432\u0448\u0438\u0439 \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u043e-\u043f\u0440\u0430\u0432\u043e\u0432\u043e\u0439 \u0441\u0442\u0430\u0442\u0443\u0441 \u0430\u0440\u0445\u0438\u043f\u0435\u043b\u0430\u0433\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1923_%D0%B3%D0%BE%D0%B4\" title=\"1923 \u0433\u043e\u0434\">1923<\/a>&#160;\u2014 \u0421\u043e\u0432\u0435\u0442 \u0422\u0440\u0443\u0434\u0430 \u0438 \u041e\u0431\u043e\u0440\u043e\u043d\u044b \u043f\u0440\u0438\u043d\u044f\u043b \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u00ab\u041e\u0431 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u0421\u043e\u0432\u0435\u0442\u0430 \u043f\u043e \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0439 \u0430\u0432\u0438\u0430\u0446\u0438\u0438\u00bb \u0438 \u00ab\u041e \u0432\u043e\u0437\u043b\u043e\u0436\u0435\u043d\u0438\u0438 \u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043d\u0430\u0434\u0437\u043e\u0440\u0430 \u0437\u0430 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u043c\u0438 \u043b\u0438\u043d\u0438\u044f\u043c\u0438 \u043d\u0430 \u0413\u043b\u0430\u0432\u043d\u043e\u0435 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430\u00bb. \u0412.&#160;\u0418.&#160;\u041b\u0435\u043d\u0438\u043d \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%8D%D1%80%D0%BE%D1%84%D0%BB%D0%BE%D1%82\" title=\"\u0410\u044d\u0440\u043e\u0444\u043b\u043e\u0442\">\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430 \u0420\u0421\u0424\u0421\u0420<\/a>.&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%BC%D1%8C%D0%B5%D1%80-%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80_%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D0%B8\" title=\"\u041f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0438\">\u041f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u043c \u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0438<\/a> \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D1%8E%D1%81,_%D0%A1%D1%82%D1%8D%D0%BD%D0%BB%D0%B8\" title=\"\u0411\u0440\u044e\u0441, \u0421\u0442\u044d\u043d\u043b\u0438\">\u0421\u0442\u044d\u043d\u043b\u0438 \u041c\u0435\u043b\u044c\u0431\u0443\u0440\u043d \u0411\u0440\u044e\u0441<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1924_%D0%B3%D0%BE%D0%B4\" title=\"1924 \u0433\u043e\u0434\">1924<\/a>&#160;\u2014 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%85%D0%B8%D1%87%D0%B5%D0%B2%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%90%D0%B2%D1%82%D0%BE%D0%BD%D0%BE%D0%BC%D0%BD%D0%B0%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u041d\u0430\u0445\u0438\u0447\u0435\u0432\u0430\u043d\u0441\u043a\u0430\u044f \u0410\u0432\u0442\u043e\u043d\u043e\u043c\u043d\u0430\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u041d\u0430\u0445\u0438\u0447\u0435\u0432\u0430\u043d\u0441\u043a\u0430\u044f \u0410\u0421\u0421\u0420<\/a> \u0432 \u0441\u043e\u0441\u0442\u0430\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d\u0441\u043a\u0430\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d\u0441\u043a\u043e\u0439 \u0421\u0421\u0420<\/a>. (\u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D1%8F%D0%B1%D1%80%D1%8C\" title=\"\u041d\u043e\u044f\u0431\u0440\u044c\">\u043d\u043e\u044f\u0431\u0440\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1990_%D0%B3%D0%BE%D0%B4\" title=\"1990 \u0433\u043e\u0434\">1990 \u0433\u043e\u0434\u04