iki\/%D0%90%D1%84%D0%B8%D0%BD%D1%8B\" title=\"\u0410\u0444\u0438\u043d\u044b\">\u0410\u0444\u0438\u043d\u0430\u0445<\/a> \u0437\u0430\u043a\u043b\u044e\u0447\u0451\u043d \u0432\u043e\u0435\u043d\u043d\u043e-\u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0441\u043e\u044e\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0413\u0440\u0435\u0446\u0438\u044f\">\u0413\u0440\u0435\u0446\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%BC%D1%8B%D0%BD%D0%B8%D1%8F\" title=\"\u0420\u0443\u043c\u044b\u043d\u0438\u044f\">\u0420\u0443\u043c\u044b\u043d\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B3%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D1%8F\" title=\"\u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u044f\">\u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u0438<\/a> \u0441 \u0446\u0435\u043b\u044c\u044e \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u044f \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D0%BA%D0%B0%D0%BD%D1%8B\" class=\"mw-redirect\" title=\"\u0411\u0430\u043b\u043a\u0430\u043d\u044b\">\u0411\u0430\u043b\u043a\u0430\u043d\u0430\u0445<\/a> \u043f\u043e\u0441\u043b\u0435\u0432\u0435\u0440\u0441\u0430\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f \u0441\u0438\u043b (\u0442.&#160;\u043d. \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%90%D0%BD%D1%82%D0%B0%D0%BD%D1%82%D0%B0\" title=\"\u0411\u0430\u043b\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0410\u043d\u0442\u0430\u043d\u0442\u0430\">\u0411\u0430\u043b\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0410\u043d\u0442\u0430\u043d\u0442\u0430<\/a>\u00bb)