3d\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D1%8C%D0%BC%D0%B0%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u041a\u043e\u043b\u044c\u043c\u0430\u0440\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f\">\u041a\u043e\u043b\u044c\u043c\u0430\u0440\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f<\/a>: \u043b\u0438\u043a\u0432\u0438\u0434\u0438\u0440\u043e\u0432\u0430\u043d\u0430 \u043e\u043a\u0440\u0443\u0436\u0451\u043d\u043d\u0430\u044f \u0432 \u0440\u0430\u0439\u043e\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D1%8C%D0%BC%D0%B0%D1%80\" title=\"\u041a\u043e\u043b\u044c\u043c\u0430\u0440\">\u041a\u043e\u043b\u044c\u043c\u0430\u0440\u0430<\/a> \u043d\u0435\u043c\u0435\u0446\u043a\u0430\u044f \u0433\u0440\u0443\u043f\u043f\u0438\u0440\u043e\u0432\u043a\u0430 19-\u0439 \u043d\u0435\u043c\u0435\u0446\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0438.&#160;\u2014 \u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0430\u044f \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/HMS_Venturer_(1943)\" title=\"HMS Venturer (1943)\">HMS Venturer<\/a> \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B9%D1%82%D0%B5%D0%BD%D0%B0%D0%BD%D1%82\" title=\"\u041b\u0435\u0439\u0442\u0435\u043d\u0430\u043d\u0442\">\u043b\u0435\u0439\u0442\u0435\u043d\u0430\u043d\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9B%D0%BE%D0%BD%D0%B4%D0%B5%D1%80%D1%81,_%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81_%D0%A1%D1%82%D1%8E%D0%B0%D1%80%D1%82&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041b\u043e\u043d\u0434\u0435\u0440\u0441, \u0414\u0436\u0435\u0439\u043c\u0441 \u0421\u0442\u044e\u0430\u0440\u0442 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0414\u0436\u0435\u0439\u043c\u0441\u0430 \u00ab\u0414\u0436\u0438\u043c\u043c\u0438\u00bb \u0421. \u041b\u043e\u043d\u0434\u0435\u0440\u0441\u0430<\/a> \u043f\u043e\u0442\u043e\u043f\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D1%82%D0%B8%D0%B9_%D1%80%D0%B5%D0%B9%D1%85\" title=\"\u0422\u0440\u0435\u0442\u0438\u0439 \u0440\u0435\u0439\u0445\">\u043d\u0435\u043c\u0435\u0446\u043a\u0443\u044e<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%BB%D0%BE%D0%B4%D0%BA%D0%B0\" title=\"\u041f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430\">\u043f\u043e\u0434\u0432\u043e\u0434\u043d\u0443\u044e \u043b\u043e\u0434\u043a\u0443<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/U-864\" title=\"U-864\">U-864<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%BE%D0%B5_%D0%BC%D0%BE%D1%80%D0%B5\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0435 \u043c\u043e\u0440\u0435\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u043c \u043c\u043e\u0440\u0435<\/a> \u043a \u0437\u0430\u043f\u0430\u0434\u0443 \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%B3%D0%B5%D0%BD\" title=\"\u0411\u0435\u0440\u0433\u0435\u043d\">\u0411\u0435\u0440\u0433\u0435\u043d\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D1%80%D0%B2%D0%B5%D0%B3%D0%B8%D1%8F\" title=\"\u041d\u043e\u0440\u0432\u0435\u0433\u0438\u044f\">\u041d\u043e\u0440\u0432\u0435\u0433\u0438\u044f<\/a>. \u042d\u0442\u043e \u0431\u044b\u043b\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0438 \u0441 \u0442\u0435\u0445 \u043f\u043e\u0440 \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0430\u0442\u0430\u043a\u0430 \u043b\u043e\u0434\u043a\u0438 \u043f\u0440\u043e\u0442\u0438\u0432 \u043b\u043e\u0434\u043a\u0438, \u043a\u043e\u0433\u0434\u0430 \u043e\u0431\u0435 \u0431\u044b\u043b\u0438 \u0432 \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u043e\u043c \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0438.&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D1%8C%D0%B1%D0%BB%D0%BE%D0%BD%D0%B3\" title=\"\u042d\u043b\u044c\u0431\u043b\u043e\u043d\u0433\">\u042d\u043b\u044c\u0431\u0438\u043d\u0433\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%82%D0%BE%D1%87%D0%BD%D0%B0%D1%8F_%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0412\u043e\u0441\u0442\u043e\u0447\u043d\u0430\u044f \u041f\u0440\u0443\u0441\u0441\u0438\u044f\">\u0412\u043e\u0441\u0442\u043e\u0447\u043d\u0430\u044f \u041f\u0440\u0443\u0441\u0441\u0438\u044f<\/a>) \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d \u043a\u043e\u043c\u0430\u043d\u0434\u0438\u0440 \u0430\u0440\u0442\u0431\u0430\u0442\u0430\u0440\u0435\u0438 \u043a\u0430\u043f\u0438\u0442\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%BB%D0%B6%D0%B5%D0%BD%D0%B8%D1%86%D1%8B%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%98%D1%81%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u043e\u043b\u0436\u0435\u043d\u0438\u0446\u044b\u043d, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0418\u0441\u0430\u0435\u0432\u0438\u0447\">\u0410.&#160;\u0418.&#160;\u0421\u043e\u043b\u0436\u0435\u043d\u0438\u0446\u044b\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1948_%D0%B3%D0%BE%D0%B4\" title=\"1948 \u0433\u043e\u0434\">1948<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%BA%D0%B8%D0%BE\" title=\"\u0422\u043e\u043a\u0438\u043e\">\u0422\u043e\u043a\u0438\u043e<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u0412\u0441\u0435\u043c\u0438\u0440\u043d\u044b\u0439 \u0446\u0435\u043d\u0442\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B9%D0%BA%D0%B8%D0%B4%D0%BE\" title=\"\u0410\u0439\u043a\u0438\u0434\u043e\">\u0430\u0439\u043a\u0438\u0434\u043e<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B9%D0%BA%D0%B8%D0%BA%D0%B0%D0%B9\" class=\"mw-redirect\" title=\"\u0410\u0439\u043a\u0438\u043a\u0430\u0439\">\u0410\u0439\u043a\u0438\u043a\u0430\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950\" class=\"mw-redirect\" title=\"1950\">1950<\/a>&#160;\u2014 \u041c\u0430\u043b\u043e\u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u0439 \u0441\u0435\u043d\u0430\u0442\u043e\u0440-\u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0435\u0446 \u043e\u0442 \u0448\u0442\u0430\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D1%81%D0%BA%D0%BE%D0%BD%D1%81%D0%B8%D0%BD\" title=\"\u0412\u0438\u0441\u043a\u043e\u043d\u0441\u0438\u043d\">\u0412\u0438\u0441\u043a\u043e\u043d\u0441\u0438\u043d<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BA%D0%BA%D0%B0%D1%80%D1%82%D0%B8,_%D0%94%D0%B6%D0%BE%D0%B7%D0%B5%D1%84_%D0%A0%D0%B5%D0%B9%D0%BC%D0%BE%D0%BD%D0%B4\" class=\"mw-redirect\" title=\"\u041c\u0430\u043a\u043a\u0430\u0440\u0442\u0438, \u0414\u0436\u043e\u0437\u0435\u0444 \u0420\u0435\u0439\u043c\u043e\u043d\u0434\">\u0414\u0436\u043e\u0437\u0435\u0444 \u041c\u0430\u043a\u043a\u0430\u0440\u0442\u0438<\/a> \u0432\u044b\u0441\u0442\u0443\u043f\u0438\u043b \u0432 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u043c \u0436\u0435\u043d\u0441\u043a\u043e\u043c \u043a\u043b\u0443\u0431\u0435 \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 \u0423\u0438\u043b\u0438\u043d\u0433 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D0%B0%D1%8F_%D0%92%D0%B8%D1%80%D0%B4%D0%B6%D0%B8%D0%BD%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u0417\u0430\u043f\u0430\u0434\u043d\u0430\u044f \u0412\u0438\u0440\u0434\u0436\u0438\u043d\u0438\u044f\">\u0417\u0430\u043f\u0430\u0434\u043d\u043e\u0439 \u0412\u0438\u0440\u0434\u0436\u0438\u043d\u0438\u0438<\/a> \u0441 \u0440\u0435\u0447\u044c\u044e, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0437\u0430\u044f\u0432\u043b\u044f\u043b, \u0447\u0442\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0434\u0435\u043f\u0430\u0440\u0442\u0430\u043c\u0435\u043d\u0442 \u0421\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u043d\u044b\u0445 \u0428\u0442\u0430\u0442\u043e\u0432 \u043f\u0440\u043e\u0441\u0442\u043e \u0437\u0430\u043f\u043e\u043b\u043d\u0435\u043d \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0430\u043c\u0438, \u0430 \u0432 \u0434\u0435\u043f\u0430\u0440\u0442\u0430\u043c\u0435\u043d\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%87%D0%B5%D1%81%D0%BE%D0%BD,_%D0%94%D0%B8%D0%BD\" title=\"\u0410\u0447\u0435\u0441\u043e\u043d, \u0414\u0438\u043d\">\u0414\u0438\u043d\u0430 \u0410\u0447\u0435\u0441\u043e\u043d\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%81%D0%B5%D0%BA%D1%80%D0%B5%D1%82%D0%B0%D1%80%D1%8C_%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0413\u043e\u0441\u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u044c \u0421\u0428\u0410\">\u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u044c<\/a> \u043f\u0440\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D1%83%D0%BC%D1%8D%D0%BD,_%D0%93%D0%B0%D1%80%D1%80%D0%B8\" title=\"\u0422\u0440\u0443\u043c\u044d\u043d, \u0413\u0430\u0440\u0440\u0438\">\u0422\u0440\u0443\u043c\u044d\u043d\u0435<\/a>) \u0438\u0445 \u0447\u0438\u0441\u043b\u043e \u0434\u043e\u0441\u0442\u0438\u0433\u043b\u043e 205 \u0447\u0435\u043b\u043e\u0432\u0435\u043a. \u0418\u043c\u044f \u0441\u0435\u043d\u0430\u0442\u043e\u0440\u0430 \u0441\u0440\u0430\u0437\u0443 \u0436\u0435 \u043f\u043e\u044f\u0432\u0438\u043b\u043e\u0441\u044c \u043d\u0430 \u043f\u0435\u0440\u0432\u044b\u0445 \u043f\u043e\u043b\u043e\u0441\u0430\u0445 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B7%D0%B5%D1%82%D0%B0\" title=\"\u0413\u0430\u0437\u0435\u0442\u0430\">\u0433\u0430\u0437\u0435\u0442<\/a>, \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B4%D0%B8%D0%BE\" title=\"\u0420\u0430\u0434\u0438\u043e\">\u0440\u0430\u0434\u0438\u043e<\/a> \u0438 \u0442\u043e\u043b\u044c\u043a\u043e \u043f\u043e\u043b\u0443\u0447\u0438\u0432\u0448\u0435\u043c \u0440\u0430\u0441\u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%BB%D0%B5%D0%B2%D0%B8%D0%B4%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0422\u0435\u043b\u0435\u0432\u0438\u0434\u0435\u043d\u0438\u0435\">\u0442\u0435\u043b\u0435\u0432\u0438\u0434\u0435\u043d\u0438\u0438<\/a>. \u0418\u043c\u0435\u043d\u043d\u043e \u0441 \u044d\u0442\u043e\u0433\u043e \u0432\u044b\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u044f \u0438 \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BA%D0%BA%D0%B0%D1%80%D1%82%D0%B8%D0%B7%D0%BC\" title=\"\u041c\u0430\u043a\u043a\u0430\u0440\u0442\u0438\u0437\u043c\">\u043c\u0430\u043a\u043a\u0430\u0440\u0442\u0438\u0441\u0442\u0441\u043a\u043e\u0435 \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1953\" class=\"mw-redirect\" title=\"1953\">1953<\/a>&#160;\u2014 \u041d\u0430 \u0444\u043e\u043d\u0435 \u0440\u0430\u0437\u0432\u043e\u0440\u0430\u0447\u0438\u0432\u0430\u044e\u0449\u0435\u0433\u043e\u0441\u044f \u0432 \u0421\u0421\u0421\u0420 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BB%D0%BE_%D0%B2%D1%80%D0%B0%D1%87%D0%B5%D0%B9\" title=\"\u0414\u0435\u043b\u043e \u0432\u0440\u0430\u0447\u0435\u0439\">\u0414\u0435\u043b\u0430 \u0432\u0440\u0430\u0447\u0435\u0439<\/a>, \u0432 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u043c \u043f\u043e\u0441\u043e\u043b\u044c\u0441\u0442\u0432\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%BB%D1%8C-%D0%90%D0%B2%D0%B8%D0%B2\" title=\"\u0422\u0435\u043b\u044c-\u0410\u0432\u0438\u0432\">\u0422\u0435\u043b\u044c-\u0410\u0432\u0438\u0432\u0435<\/a> (\u043d\u0430 \u0431\u0443\u043b\u044c\u0432\u0430\u0440\u0435 \u0420\u043e\u0442\u0448\u0438\u043b\u044c\u0434\u0430 46), \u0431\u044b\u043b\u0430 \u0432\u0437\u043e\u0440\u0432\u0430\u043d\u0430 \u0431\u043e\u043c\u0431\u0430. \u0412\u0437\u0440\u044b\u0432\u043d\u043e\u0435 \u0443\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u043e \u0432\u0435\u0441\u043e\u043c \u0432 30 \u043a\u0433 (\u043f\u043e \u0434\u0440\u0443\u0433\u043e\u0439 \u0432\u0435\u0440\u0441\u0438\u0438&#160;\u2014 15 \u043a\u0433) \u0441\u0440\u0430\u0431\u043e\u0442\u0430\u043b\u043e \u0443 \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0439 \u0441\u0442\u0435\u043d\u044b \u043c\u0438\u0441\u0441\u0438\u0438 \u0432 21:45 (\u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0435 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u044b \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u044e\u0442 \u0438\u043d\u043e\u0435 \u0432\u0440\u0435\u043c\u044f&#160;\u2014 22:35). \u0417\u0434\u0430\u043d\u0438\u044e \u0431\u044b\u043b \u043f\u0440\u0438\u0447\u0438\u043d\u0435\u043d \u0437\u043d\u0430\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u0443\u0449\u0435\u0440\u0431: \u0431\u044b\u043b\u0438 \u0432\u044b\u0431\u0438\u0442\u044b \u0432\u0441\u0435 \u0441\u0442\u0435\u043a\u043b\u0430, \u043e\u043a\u043e\u043d\u043d\u044b\u0435 \u0440\u0430\u043c\u044b \u0438 \u0434\u0432\u0435\u0440\u0438 \u043d\u0430 \u043f\u0435\u0440\u0432\u043e\u043c, \u0432\u0442\u043e\u0440\u043e\u043c \u0438 \u0447\u0430\u0441\u0442\u0438\u0447\u043d\u043e \u0442\u0440\u0435\u0442\u044c\u0435\u043c \u044d\u0442\u0430\u0436\u0430\u0445. \u0418\u043c\u0435\u043b\u0438\u0441\u044c \u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u0438\u0435 \u0436\u0435\u0440\u0442\u0432\u044b&#160;\u2014 \u0442\u044f\u0436\u0435\u043b\u043e \u0440\u0430\u043d\u0435\u043d\u0430 \u0410.&#160;\u041f.&#160;\u0421\u044b\u0441\u043e\u0435\u0432\u0430 \u0436\u0435\u043d\u0430 \u0437\u0430\u0432\u0445\u043e\u0437\u0430. \u041a\u0440\u043e\u043c\u0435 \u0442\u043e\u0433\u043e, \u0440\u0430\u043d\u0435\u043d\u0438\u044f \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u043e\u0439 \u0441\u0442\u0435\u043f\u0435\u043d\u0438 \u0442\u044f\u0436\u0435\u0441\u0442\u0438 \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0438 \u041a.&#160;\u0412.&#160;\u0415\u0440\u0448\u043e\u0432\u0430&#160;\u2014 \u0436\u0435\u043d\u0430 \u043f\u043e\u0441\u043b\u0430\u043d\u043d\u0438\u043a\u0430 \u0438 \u0448\u043e\u0444\u0435\u0440 \u043c\u0438\u0441\u0441\u0438\u0438 \u0418.&#160;\u0413.&#160;\u0413\u0440\u0438\u0448\u0438\u043d. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/11_%D1%84%D0%B5%D0%B2%D1%80%D0%B0%D0%BB%D1%8F\" title=\"11 \u0444\u0435\u0432\u0440\u0430\u043b\u044f\">11 \u0444\u0435\u0432\u0440\u0430\u043b\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0440\u0430\u0437\u043e\u0440\u0432\u0430\u043b \u0434\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8C\" title=\"\u0418\u0437\u0440\u0430\u0438\u043b\u044c\">\u0418\u0437\u0440\u0430\u0438\u043b\u0435\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961\" class=\"mw-redirect\" title=\"1961\">1961<\/a>&#160;\u2014 \u041f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u0444\u0438\u043b\u044c\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B0\" title=\"\u041f\u043e\u043b\u044c\u0448\u0430\">\u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e<\/a> \u0440\u0435\u0436\u0438\u0441\u0441\u0451\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B2%D0%B0%D0%BB%D0%B5%D1%80%D0%BE%D0%B2%D0%B8%D1%87,_%D0%95%D0%B6%D0%B8\" title=\"\u041a\u0430\u0432\u0430\u043b\u0435\u0440\u043e\u0432\u0438\u0447, \u0415\u0436\u0438\">\u0415\u0436\u0438 \u041a\u0430\u0432\u0430\u043b\u0435\u0440\u043e\u0432\u0438\u0447\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%82%D1%8C_%D0%98%D0%BE%D0%B0%D0%BD%D0%BD%D0%B0_%D0%BE%D1%82_%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D0%BE%D0%B2_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC)\" title=\"\u041c\u0430\u0442\u044c \u0418\u043e\u0430\u043d\u043d\u0430 \u043e\u0442 \u0430\u043d\u0433\u0435\u043b\u043e\u0432 (\u0444\u0438\u043b\u044c\u043c)\">\u041c\u0430\u0442\u044c \u0418\u043e\u0430\u043d\u043d\u0430 \u043e\u0442 \u0430\u043d\u0433\u0435\u043b\u043e\u0432<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1963\" class=\"mw-redirect\" title=\"1963\">1963<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u0443\u0437\u043a\u043e\u0444\u044e\u0437\u0435\u043b\u044f\u0436\u043d\u043e\u0433\u043e \u0441\u0440\u0435\u0434\u043d\u0435\u043c\u0430\u0433\u0438\u0441\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043a\u043e\u0433\u043e \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Boeing_727\" title=\"Boeing 727\">Boeing 727<\/a>. \u0421 60-\u0445 \u043f\u043e 80-\u0435 \u0433\u043e\u0434\u044b Boeing 727 \u044f\u0432\u043b\u044f\u043b\u0441\u044f \u043e\u0434\u043d\u0438\u043c \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u044b\u0445 \u0430\u0432\u0438\u0430\u043b\u0430\u0439\u043d\u0435\u0440\u043e\u0432 \u0432 \u043c\u0438\u0440\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1964\" class=\"mw-redirect\" title=\"1964\">1964<\/a>&#160;\u2014 \u0417\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0438\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B8%D0%BC%D0%BD%D0%B8%D0%B5_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B_1964\" title=\"\u0417\u0438\u043c\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b 1964\">IX \u0437\u0438\u043c\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b<\/a>. \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B4%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B7%D0%B0%D1%87%D1%91%D1%82_%D0%BD%D0%B0_%D0%B7%D0%B8%D0%BC%D0%BD%D0%B8%D1%85_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D1%85_%D0%B8%D0%B3%D1%80%D0%B0%D1%85_1964\" title=\"\u041c\u0435\u0434\u0430\u043b\u044c\u043d\u044b\u0439 \u0437\u0430\u0447\u0451\u0442 \u043d\u0430 \u0437\u0438\u043c\u043d\u0438\u0445 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0445 \u0438\u0433\u0440\u0430\u0445 1964\">\u043c\u0435\u0434\u0430\u043b\u044c\u043d\u043e\u043c \u0437\u0430\u0447\u0451\u0442\u0435<\/a> \u043b\u0443\u0447\u0448\u0438\u043c\u0438 \u0431\u044b\u043b\u0438 \u0441\u043f\u043e\u0440\u0442\u0441\u043c\u0435\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0_%D0%BD%D0%B0_%D0%B7%D0%B8%D0%BC%D0%BD%D0%B8%D1%85_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D1%85_%D0%B8%D0%B3%D1%80%D0%B0%D1%85_1964\" title=\"\u0421\u0421\u0421\u0420 \u043d\u0430 \u0437\u0438\u043c\u043d\u0438\u0445 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0445 \u0438\u0433\u0440\u0430\u0445 1964\">\u0421\u0421\u0421\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1965\" class=\"mw-redirect\" title=\"1965\">1965<\/a>&#160;\u2014 \u041f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u0444\u0438\u043b\u044c\