e\u0441\u043d\u0438\u0439\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B6%D0%B4%D1%83%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BD%D1%84%D0%B5%D1%80%D0%B5%D0%BD%D1%86%D0%B8%D1%8F_%D0%BF%D0%BE_%D0%B1%D1%8B%D0%B2%D1%88%D0%B5%D0%B9_%D0%AE%D0%B3%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D0%B8\" title=\"\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f \u043f\u043e \u0431\u044b\u0432\u0448\u0435\u0439 \u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u0438\">\u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0439 \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u0435\u0439 \u043f\u043e \u0431\u044b\u0432\u0448\u0435\u0439 \u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u0438<\/a> \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d \u00ab\u041f\u043b\u0430\u043d \u0412\u044d\u043d\u0441\u0430-\u041e\u0443\u044d\u043d\u0430\u00bb, \u0441\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%81%D0%BD%D0%B8%D1%8F_%D0%B8_%D0%93%D0%B5%D1%80%D1%86%D0%B5%D0%B3%D0%BE%D0%B2%D0%B8%D0%BD%D0%B0\" title=\"\u0411\u043e\u0441\u043d\u0438\u044f \u0438 \u0413\u0435\u0440\u0446\u0435\u0433\u043e\u0432\u0438\u043d\u0430\">\u0411\u043e\u0441\u043d\u0438\u044f \u0438 \u0413\u0435\u0440\u0446\u0435\u0433\u043e\u0432\u0438\u043d\u0430<\/a> \u0434\u0435\u043b\u0438\u043b\u0430\u0441\u044c \u043d\u0430 10 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0445 \u043a\u0430\u043d\u0442\u043e\u043d\u043e\u0432. \u0421\u0442\u043e\u043b\u0438\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%80%D0%B0%D0%B5%D0%B2%D0%BE\" title=\"\u0421\u0430\u0440\u0430\u0435\u0432\u043e\">\u0421\u0430\u0440\u0430\u0435\u0432\u043e<\/a> \u0434\u0435\u043c\u0438\u043b\u0438\u0442\u0430\u0440\u0438\u0437\u0438\u0440\u043e\u0432\u0430\u043b\u0430\u0441\u044c. \u041e\u0442\u0432\u0435\u0440\u0433\u043d\u0443\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%A1%D0%B5%D1%80%D0%B1%D1%81%D0%BA%D0%B0%D1%8F\" title=\"\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0421\u0435\u0440\u0431\u0441\u043a\u0430\u044f\">\u0441\u0435\u0440\u0431\u0441\u043a\u043e\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u043e\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1996_%D0%B3%D0%BE%D0%B4\" title=\"1996 \u0433\u043e\u0434\">1996<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%82_%D1%82%D1%8F%D0%B6%D1%91%D0%BB%D1%8B%D1%85_%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2\" title=\"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0442\u044f\u0436\u0451\u043b\u044b\u0445 \u0438\u043e\u043d\u043e\u0432\">\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442\u0435 \u0442\u044f\u0436\u0451\u043b\u044b\u0445 \u0438\u043e\u043d\u043e\u0432<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D1%80%D0%BC%D1%88%D1%82%D0%B0%D0%B4%D1%82\" title=\"\u0414\u0430\u0440\u043c\u0448\u0442\u0430\u0434\u0442\">\u0414\u0430\u0440\u043c\u0448\u0442\u0430\u0434\u0442\u0435<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u043e \u043e\u0431 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0438 112-\u0433\u043e \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u0430 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%82%D0%BE%D0%BC%D0%BD%D0%B0%D1%8F_%D0%BC%D0%B0%D1%81%D1%81%D0%B0\" title=\"\u0410\u0442\u043e\u043c\u043d\u0430\u044f \u043c\u0430\u0441\u0441\u0430\">\u0430\u0442\u043e\u043c\u043d\u043e\u0439 \u043c\u0430\u0441\u0441\u043e\u0439<\/a> 285, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BF%D0%B5%D1%80%D0%BD%D0%B8%D1%86%D0%B8%D0%B9\" title=\"\u041a\u043e\u043f\u0435\u0440\u043d\u0438\u0446\u0438\u0439\">\u00ab\u043a\u043e\u043f\u0435\u0440\u043d\u0438\u0446\u0438\u044f\u00bb<\/a> .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1998_%D0%B3%D0%BE%D0%B4\" title=\"1998 \u0433\u043e\u0434\">1998<\/a>&#160;\u2014 \u041f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u0435 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%93%D1%80%D1%83%D0%B7%D0%B8%D0%B8\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0413\u0440\u0443\u0437\u0438\u0438\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 \u0413\u0440\u0443\u0437\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B5%D0%B2%D0%B0%D1%80%D0%B4%D0%BD%D0%B0%D0%B4%D0%B7%D0%B5,_%D0%AD%D0%B4%D1%83%D0%B0%D1%80%D0%B4_%D0%90%D0%BC%D0%B2%D1%80%D0%BE%D1%81%D0%B8%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0428\u0435\u0432\u0430\u0440\u0434\u043d\u0430\u0434\u0437\u0435, \u042d\u0434\u0443\u0430\u0440\u0434 \u0410\u043c\u0432\u0440\u043e\u0441\u0438\u0435\u0432\u0438\u0447\">\u042d\u0434\u0443\u0430\u0440\u0434\u0430 \u0428\u0435\u0432\u0430\u0440\u0434\u043d\u0430\u0434\u0437\u0435<\/a>. \u0412 \u0446\u0435\u043d\u0442\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B1%D0%B8%D0%BB%D0%B8%D1%81%D0%B8\" title=\"\u0422\u0431\u0438\u043b\u0438\u0441\u0438\">\u0422\u0431\u0438\u043b\u0438\u0441\u0438<\/a> \u0435\u0433\u043e \u043a\u043e\u0440\u0442\u0435\u0436 \u0431\u044b\u043b \u043e\u0431\u0441\u0442\u0440\u0435\u043b\u044f\u043d \u0438\u0437 \u0433\u0440\u0430\u043d\u0430\u0442\u043e\u043c\u0435\u0442\u0430 \u0438 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043e\u0440\u0443\u0436\u0438\u044f. \u041e\u0434\u043d\u0430\u043a\u043e \u0431\u0440\u043e\u043d\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Mercedes-Benz\" title=\"Mercedes-Benz\">\u041c\u0435\u0440\u0441\u0435\u0434\u0435\u0441<\/a>\u00bb \u0441\u043f\u0430\u0441 \u0435\u043c\u0443 \u0436\u0438\u0437\u043d\u044c.&#160;\u2014 \u0420\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u0430 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D1%88%D0%BD%D0%B0%D0%BA%D1%86%D1%83%D1%82%D1%8E%D0%BD\" title=\"\u0414\u0430\u0448\u043d\u0430\u043a\u0446\u0443\u0442\u044e\u043d\">\u0410\u0440\u043c\u044f\u043d\u0441\u043a\u043e\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u043e\u0439 \u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438 \u0414\u0430\u0448\u043d\u0430\u043a\u0446\u0443\u0442\u044e\u043d<\/a>, \u0441\u0442\u0430\u0440\u0435\u0439\u0448\u0435\u0439 \u043e\u043f\u043f\u043e\u0437\u0438\u0446\u0438\u043e\u043d\u043d\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%BC%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u0410\u0440\u043c\u0435\u043d\u0438\u044f\">\u0410\u0440\u043c\u0435\u043d\u0438\u0438<\/a>.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2001\" class=\"mw-redirect\" title=\"2001\">2001<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%BC%D1%8C%D0%B5%D1%80-%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80_%D0%A2%D0%B0%D0%B8%D0%BB%D0%B0%D0%BD%D0%B4%D0%B0\" class=\"mw-redirect\" title=\"\u041f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u0422\u0430\u0438\u043b\u0430\u043d\u0434\u0430\">\u041f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u043c \u0422\u0430\u0438\u043b\u0430\u043d\u0434\u0430<\/a> \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B8%D0%BD%D0%BD%D0%B0%D0%B2%D0%B0%D1%82,_%D0%A2%D0%B0%D0%BA%D1%81%D0%B8%D0%BD\" title=\"\u0427\u0438\u043d\u043d\u0430\u0432\u0430\u0442, \u0422\u0430\u043a\u0441\u0438\u043d\">\u0422\u0430\u043a\u0441\u0438\u043d \u0427\u0438\u043d\u043d\u0430\u0432\u0430\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2004_%D0%B3%D0%BE%D0%B4\" title=\"2004 \u0433\u043e\u0434\">2004<\/a>&#160;\u2014 \u0412 \u0410\u043d\u0433\u043e\u043b\u0435 \u043f\u043e\u0433\u0438\u0431 \u043e\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0442\u0435\u043b\u0435\u043a\u0430\u043d\u0430\u043b\u0430 \u041d\u0422\u0412 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%92%D1%8F%D1%87%D0%B5%D1%81%D0%BB%D0%B0%D0%B2_%D0%A3%D1%82%D0%BA%D0%B8%D0%BD&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0412\u044f\u0447\u0435\u0441\u043b\u0430\u0432 \u0423\u0442\u043a\u0438\u043d (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0412\u044f\u0447\u0435\u0441\u043b\u0430\u0432 \u0423\u0442\u043a\u0438\u043d<\/a>. \u041e\u043d \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0441\u044f \u0432 \u0410\u043d\u0433\u043e\u043b\u0435 \u043f\u043e \u0437\u0430\u0434\u0430\u043d\u0438\u044e \u0440\u0435\u0434\u0430\u043a\u0446\u0438\u0438, \u0440\u0430\u0431\u043e\u0442\u0430\u043b \u043d\u0430\u0434 \u043e\u0447\u0435\u0440\u0435\u0434\u043d\u044b\u043c \u0441\u044e\u0436\u0435\u0442\u043e\u043c.&#160;\u2014 \u041d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%BA%D0%BE%D1%80%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD\" title=\"\u041b\u0435\u043d\u043a\u043e\u0440\u0430\u043d\u0441\u043a\u0438\u0439 \u0440\u0430\u0439\u043e\u043d\">\u041b\u044f\u043d\u043a\u0430\u0440\u0430\u043d\u0441\u043a\u043e\u0433\u043e<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%81%D1%82%D0%B0%D1%80%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%